import logo from './logo.svg';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './pages/HomePage';
import Tabs from './components/Tabs';
import OtherTab from './pages/OtherTab';


const App = () => {
  const currencies = ["USD", "EUR", "GBP", "SGD"];

  return (
    <Router>
      <div>
        <Tabs />
        <Routes>
          <Route exact path="/" element={<HomePage currencies={currencies} />} />
          <Route path="/tab1" element={<OtherTab />} />
          <Route path="/tab2" element={<OtherTab />} />

        </Routes>
      </div>
    </Router>
  )
}

export default App;
